import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import "./AllAssessments.css";

const AllAssessments = () => {
  const navigate = useNavigate();

  const onBackToHomepageClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  return (
    <div className="all-assessments">
      <div className="assessment">
        <div className="back-to-homepage" onClick={onBackToHomepageClick}>
          Back to Homepage
        </div>
        <img className="berry-blitz-button" alt="" src="/image-1@2x.png" />
        <img className="magic-castle-icon1" alt="" src="/magic-castle@2x.png" />
        <div className="magic-castle2">
          <span className="magic-castle-txt-container1">
            <p className="magic1">{`MAGIC `}</p>
            <p className="magic1">CASTLE</p>
          </span>
        </div>
        <img
          className="screenshot-2024-08-25-213042-1"
          alt=""
          src="/screenshot-20240825-213042-1@2x.png"
        />
      </div>
    </div>
  );
};

export default AllAssessments;
